function maximumTripletValue(nums: number[]): number {
    let maxVal = 0;
    let minVal1 = Number.MAX_SAFE_INTEGER, minVal2 = Number.MAX_SAFE_INTEGER;
    let maxVal1 = Number.MIN_SAFE_INTEGER, maxVal2 = Number.MIN_SAFE_INTEGER, maxVal3 = Number.MIN_SAFE_INTEGER;

    for (let num of nums) {
        if (num <= minVal1) {
            minVal2 = minVal1;
            minVal1 = num;
        } else if (num <= minVal2) {
            minVal2 = num;
        }

        if (num >= maxVal1) {
            maxVal3 = maxVal2;
            maxVal2 = maxVal1;
            maxVal1 = num;
        } else if (num >= maxVal2) {
            maxVal3 = maxVal2;
            maxVal2 = num;
        } else if (num >= maxVal3) {
            maxVal3 = num;
        }
    }

    maxVal = Math.max((minVal1 - minVal2) * maxVal1, (maxVal1 - maxVal2) * maxVal3);
    return maxVal > 0 ? maxVal : 0;
};
